declare @data table (accountnumber varchar(10))

select distinct
	pd10.DF_PRS_ID,
	'BRENDA TICKET 43326 ACCT NUMBER LOOKUP'
from 
	cdw..PD10_PRS_NME pd10
	inner join @data d
		on pd10.DF_SPE_ACC_ID = d.accountnumber
	left join cdw..CS_Transfer_Exclusions ex
		on ex.BF_SSN = pd10.DF_PRS_ID
where 
	ex.bf_ssn is null